INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かりん", 37, 0, 0, 2, 0, 0, 118501, 118501, "カリン", 787, "2021/10/19 12:00:00", 1, 37, 0, 450, 0, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 1, 0, 118501, 2.0, 0, "2030/12/31 15:00:00", 118501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねびあ", 0, 0, 0, 2, 0, 0, 118601, 118601, "ネビア", 826, "2024/08/10 21:00:00", 3, 0, 0, 450, 0, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 1, 0, 118601, 2.0, 0, "2030/12/31 15:00:00", 118601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いお", 7, 0, 0, 2, 0, 0, 119001, 119001, "イオ（ノワール）", 714, "2021/11/03 19:00:00", 3, 7, 0, 450, 15, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 0, 0, 119001, 2.27, 0, "2030/12/31 15:00:00", 119001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くうか", 7, 0, 0, 2, 0, 0, 119101, 119101, "クウカ（ノワール）", 143, "2021/11/16 12:00:00", 3, 26, 0, 450, 12, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 0, 0, 119101, 2.545, 0, "2030/12/31 15:00:00", 119101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("まひる", 6, 0, 0, 1, 0, 0, 119201, 119201, "マヒル（クリスマス）", 397, "2023/09/19 15:00:00", 1, 6, 0, 450, 5, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 1, 0, 119201, 2.19, 0, "2030/12/31 15:00:00", 119201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りの", 8, 0, 0, 1, 0, 0, 119301, 119301, "リノ（クリスマス）", 762, "2021/12/22 12:00:00", 3, 8, 0, 450, 6, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 0, 0, 119301, 1.97, 0, "2030/12/31 15:00:00", 119301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぺこりーぬ", 5, 0, 0, 0, 0, 0, 119401, 0, "ぺコリーヌ", 0, "2022/01/31 12:00:00", 1, 0, 0, 0, 0, "", 0, 0, 119401, 0.0, 0, "2030/12/31 15:00:00", 0);
