INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しぇふぃ", 4, 0, 0, 1, 0, 0, 120701, 120701, "シェフィ（ニューイヤー）", 283, "2025/01/15 15:00:00", 3, 22, 0, 450, 1, "【物理】前衛で、雪花舞う晴れ空をゆく新春氷竜少女。\nＵＢで顕現させる氷竜の牙で味方への強化スキルを高め\n自身の範囲攻撃技と共に苛烈な攻勢で敵陣を凍滅する。", 1, 0, 120701, 1.84, 0, "2025/01/20 11:59:59", 120701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("るか", 4, 0, 0, 1, 0, 0, 120801, 120801, "ルカ（ニューイヤー）", 193, "2023/10/16 15:00:00", 1, 22, 0, 450, 2, "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 1, 0, 120801, 1.3, 0, "2030/12/31 15:00:00", 120801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いりや", 3, 0, 0, 2, 0, 0, 120901, 120901, "イリヤ（ニューイヤー）", 424, "2025/01/15 15:00:00", 3, 38, 0, 450, 12, "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 1, 0, 120901, 1.425, 0, "2025/01/20 11:59:59", 120901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぺこりーぬ", 5, 0, 0, 1, 0, 0, 121001, 121001, "ペコリーヌ（オーバーロード）", 164, "2025/02/20 12:00:00", 3, 41, 0, 450, 1, "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 1, 0, 121001, 2.25, 0, "2025/02/24 11:59:59", 121001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("きゃる", 7, 0, 0, 2, 0, 0, 121101, 121101, "キャル（オーバーロード）", 588, "2025/02/20 12:00:00", 3, 42, 0, 450, 1, "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 1, 0, 121101, 2.07, 0, "2025/02/24 11:59:59", 121101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らびりすた", 4, 0, 0, 1, 0, 0, 121201, 121201, "ラビリスタ（オーバーロード）", 260, "2023/11/16 15:00:00", 1, 40, 0, 450, 6, "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 1, 0, 121201, 1.55, 0, "2030/12/31 15:00:00", 121201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くるみ", 3, 0, 0, 1, 0, 0, 121301, 121301, "クルミ（ステージ）", 731, "2022/03/03 19:00:00", 3, 3, 0, 450, 3, "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 0, 0, 121301, 1.9, 0, "2030/12/31 15:00:00", 121301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みさき", 7, 0, 0, 2, 0, 0, 121401, 121401, "ミサキ（ステージ）", 742, "2022/03/15 15:00:00", 3, 7, 0, 450, 15, "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 0, 0, 121401, 2.27, 0, "2030/12/31 15:00:00", 121401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あゆみ", 6, 0, 0, 1, 0, 0, 121501, 121501, "アユミ（怪盗）", 590, "2025/04/26 12:00:00", 3, 6, 0, 450, 12, "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 1, 0, 121501, 2.0, 0, "2025/04/30 11:59:59", 121501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いのり", 3, 0, 0, 1, 0, 0, 121601, 121601, "イノリ（怪盗）", 292, "2022/04/15 15:00:00", 3, 3, 0, 450, 17, "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 0, 0, 121601, 1.425, 0, "2030/12/31 15:00:00", 121601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あきの", 0, 1, 180901, 0, 0, 0, 121701, 0, "アキノ（アキノ＆サレン）", 421, "2015/04/01 15:00:00", 3, 0, 0, 0, 0, "", 1, 0, 121701, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("されん", 0, 1, 180901, 0, 0, 0, 121801, 0, "サレン（アキノ＆サレン）", 421, "2015/04/01 15:00:00", 3, 0, 0, 0, 0, "", 1, 0, 121801, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あんな", 5, 0, 0, 2, 0, 0, 121901, 121901, "アンナ（パイレーツ）", 293, "2022/05/15 15:00:00", 3, 5, 0, 450, 12, "【魔法】前衛で己を鼓舞し高めた魔力を放つ蒼海の冥姫。\n発動の度、攻撃力とクリティカル時ダメージが上昇する\nＵＢと自己犠牲を払う強力な範囲攻撃技で敵を撃滅する。", 0, 0, 121901, 2.125, 0, "2030/12/31 15:00:00", 121901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しのぶ", 3, 0, 0, 1, 0, 0, 122001, 122001, "シノブ（パイレーツ）", 380, "2022/05/03 19:00:00", 3, 3, 0, 450, 14, "【物理】中衛で、彷徨える魂を解き放つ海星の霊能少女。\n攻撃の際、付与する【霊錨の刻印】を駆使し、ダメージ量\nアップのスキルと防御力ダウンのＵＢで敵を浄滅へ導く。", 0, 0, 122001, 1.425, 0, "2030/12/31 15:00:00", 122001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あおい", 35, 0, 0, 1, 0, 0, 122101, 122101, "アオイ（キャンプ）", 731, "2024/04/18 15:00:00", 1, 35, 0, 450, 9, "【物理】後衛で百千の矢を放つ、ぼっちの山籠りエルフ。\n物理魔法無効バリアで耐え凌ぎ、敵全体への射撃と自分の\n間合いに入った敵への強力な弓雨の追撃で掃討する。", 1, 0, 122101, 1.97, 0, "2030/12/31 15:00:00", 122101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆかり", 4, 0, 0, 1, 0, 0, 122201, 122201, "ユカリ（キャンプ）", 419, "2022/05/31 12:00:00", 3, 4, 0, 450, 8, "【物理】中衛で最高の一杯を自然と共に愉しむ元聖騎士。\n【至福のひと時】が増えるほどに、味方の物理攻撃力や\nクリティカル時のダメージを強力に強化し、勝利を掴む。", 0, 0, 122201, 1.84, 0, "2030/12/31 15:00:00", 122201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("うぁんぴぃ", 43, 0, 0, 2, 0, 0, 122301, 122301, "ヴァンピィ", 564, "2022/06/15 15:00:00", 3, 43, 0, 450, 0, "【魔法】中衛で、幼き竜と共に歩むさいきょーの吸血姫。\n味方全体の強化と、敵のＴＰを吸収するスキルで力を蓄え\nＵＢ発動後ベスと共闘し防御ダウンと強撃で攻勢に出る。", 0, 0, 122301, 1.425, 0, "2030/12/31 15:00:00", 122301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ひより", 1, 0, 0, 1, 0, 0, 122401, 122401, "ヒヨリ（サマー）", 264, "2024/06/17 15:00:00", 1, 1, 0, 450, 8, "【物理】前衛で皆にエールを送り鼓舞する真夏の元気娘。\n味方のＨＰを継続回復し行動速度アップの他、味方の数に\n応じてクリティカル強化と攻撃力を引き上げ勝利に導く。", 1, 0, 122401, 2.42, 0, "2030/12/31 15:00:00", 122401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("れい", 4, 0, 0, 1, 0, 0, 122501, 122501, "レイ（サマー）", 250, "2025/08/22 12:00:00", 3, 4, 0, 450, 0, "【物理】前衛で水刃の加護を纏い水面を駆ける渚の剣士。\nクリティカル時のダメージを底上げしＵＢ発動の度、纏う\n【水刃の加護】で全スキルダメージを上げ、敵陣を穿つ。", 1, 0, 122501, 1.965, 0, "2025/08/31 11:59:59", 122501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆい", 7, 0, 0, 2, 0, 0, 122601, 122601, "ユイ（サマー）", 554, "2022/07/15 15:00:00", 3, 7, 0, 450, 0, "【魔法】中衛で、魔法キャラを補助する夜凪の魔法士。\n累積する攻撃強化スキルとＴＰ回復、物魔両面の無効\nバリアや継続ＨＰ回復で攻守共に味方を支え勝利へ導く。", 0, 0, 122601, 2.27, 0, "2030/12/31 15:00:00", 122601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("きょうか", 7, 0, 0, 2, 0, 0, 122701, 122701, "キョウカ（サマー）", 812, "2022/08/15 15:00:00", 3, 7, 0, 450, 0, "【魔法】後衛で、難しい魔法の練習に励む海辺の優等生。\nランダムな敵に当たるスキルの威力は攻撃の際に付与する\n【バタフライシール】で増幅し、防御力もダウンさせる。", 0, 0, 122701, 1.92, 0, "2030/12/31 15:00:00", 122701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みそぎ", 1, 0, 0, 1, 0, 0, 122801, 122801, "ミソギ（サマー）", 237, "2024/07/16 15:00:00", 1, 1, 0, 450, 0, "【物理】前衛で敵後方に花火を仕掛ける夜涼みの悪戯娘。\n敵の最前衛をスタンで足止めしつつ、最後衛を中心とした\nＵＢで狭範囲の敵を引き寄せ、ＴＰダウンで攻勢を阻む。", 1, 0, 122801, 2.295, 0, "2030/12/31 15:00:00", 122801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みみ", 5, 0, 0, 1, 0, 0, 122901, 122901, "ミミ（サマー）", 361, "2025/08/22 12:00:00", 3, 5, 0, 450, 0, "【物理】中衛で巨大バルーンと跳ね回る夏色うさぎっこ。\nＵＢやスキルで全てのマルチターゲットに追加ダメージを\n与え、自己強化と防御力ダウンで強敵のブレイクを狙う。", 1, 0, 122901, 2.25, 0, "2025/08/31 11:59:59", 122901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あめす", 44, 0, 0, 2, 0, 0, 123001, 123001, "アメス", 746, "2025/06/27 12:00:00", 3, 44, 0, 450, 0, "【魔法】後衛で、新たな姿で騎士の冒険を支える妖精。\nダメージカットや防御力アップ、無効バリアで味方を護り\nバリアを起点とする攻撃力とＴＰの支援で攻勢に転ずる。", 1, 0, 123001, 2.27, 0, "2025/06/30 11:59:59", 123001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("まほ", 7, 0, 0, 2, 0, 0, 123101, 123101, "マホ（エクスプローラー）", 793, "2022/09/03 19:00:00", 3, 7, 0, 450, 0, "【魔法】後衛でぬいぐるみ達と大冒険に挑むマホ隊員。\n味方に付与する【ふわふわウール】は被ダメージ時に消費\nされＴＰを回復し、一気呵成の反撃で活路を切り拓く。", 0, 0, 123101, 1.795, 0, "2030/12/31 15:00:00", 123101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あやね", 3, 0, 0, 1, 0, 0, 123201, 123201, "アヤネ（エクスプローラー）", 256, "2022/09/15 15:00:00", 3, 3, 0, 450, 0, "【物理】前衛で、相棒と困難を越え猛進するアヤネ隊員。\n群る敵を二つの範囲攻撃で一気に捉え、周囲の味方の物理\n攻撃力とクリティカルアップで冒険を阻む壁を打ち崩す。", 0, 0, 123201, 1.425, 0, "2030/12/31 15:00:00", 123201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねあ", 1, 0, 0, 1, 0, 0, 123301, 123301, "ネア", 350, "2025/09/16 15:00:00", 3, 0, 0, 450, 0, "【物理】中衛で粘液を振りまくキイロいスライムギャル。\nスキルで敵全体の物理攻撃能力やＴＰ上昇を低下させ、\nＵＢでスライム化し全敵を攻撃しつつ無敵ボディを得る。", 1, 0, 123301, 1.62, 0, "2025/09/30 11:59:59", 123301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("じゅん", 5, 0, 0, 0, 0, 0, 123401, 0, "ジュン（キャンプ）", 0, "2015/04/01 15:00:00", 3, 5, 0, 0, 0, "", 0, 0, 123401, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りん", 6, 0, 0, 1, 0, 0, 123501, 123501, "リン（ハロウィン）", 583, "2024/09/17 15:00:00", 1, 6, 0, 450, 0, "【物理】中衛で敵を悪戯で翻弄する恐怖のキョンシー娘。\n最も魔法攻撃力が高い敵に急襲を仕掛け、ＴＰ減少や魔法\n攻撃力ダウン、スタン等の妨害スキルで機先を制する。", 1, 0, 123501, 2.34, 0, "2030/12/31 15:00:00", 123501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("とも", 4, 0, 0, 1, 0, 0, 123601, 123601, "トモ（ハロウィン）", 262, "2024/10/24 12:00:00", 3, 4, 0, 450, 0, "【物理】前衛で、同志と力を合わせ共に戦う夜廻り剣士。\n自分と物理攻撃力が最も高い味方１キャラの攻撃力を大幅\nに上昇させ、目にもとまらぬ剣技で不届き者を成敗する。", 1, 0, 123601, 1.965, 0, "2024/10/28 11:59:59", 123601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ななか", 7, 0, 0, 2, 0, 0, 123701, 123701, "ナナカ（ハロウィン）", 741, "2022/10/15 15:00:00", 3, 21, 0, 450, 0, "【魔法】後衛で、オタ活に精を出すハロウィン魔法少女。\nＨＰ回復量ダウンで敵の戦略を崩し、ダメージフィールド\nと対象の数で火傷の威力を増す熱狂の炎が敵を包み込む。", 0, 0, 123701, 2.07, 0, "2030/12/31 15:00:00", 123701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くりすてぃーな", 1, 0, 0, 1, 0, 0, 123801, 123801, "クリスティーナ（ワイルド）", 238, "2024/11/26 12:00:00", 3, 1, 0, 450, 0, "【物理】前衛で、戦場を跳ね回るラビット姿の誓約女君。\n物理攻撃を全て回避するスキルと攻撃力の強化で敵陣に\n単身特攻をかけ、ＵＢの範囲攻撃で敵を内から薙ぎ倒す。", 1, 0, 123801, 2.295, 0, "2024/11/30 11:59:59", 123801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("まつり", 2, 0, 0, 1, 0, 0, 123901, 123901, "マツリ（ワイルド）", 183, "2022/11/15 15:00:00", 3, 2, 0, 450, 0, "【物理】前衛で母製の鎧を纏い気合い上々の獣人族騎士。\n自分のＨＰが低いほど与えるダメージと無効バリアの耐久\n力を高め、防御力ダウンと永続攻撃アップで活路を拓く。", 0, 0, 123901, 2.125, 0, "2030/12/31 15:00:00", 123901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あかり", 7, 0, 0, 2, 0, 0, 124001, 124001, "アカリ（クリスマス）", 438, "2024/12/22 12:00:00", 3, 7, 0, 450, 0, "【魔法】中衛で、聖夜の街に幸せを運ぶ双子の妹サンタ。\n自分の魔法攻撃力に応じて効果が上がる味方全体への攻撃\n力強化に加え、単体特大魔法攻撃で勝利の旋律を奏でる。", 1, 0, 124001, 2.07, 0, "2024/12/31 11:59:59", 124001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("より", 6, 0, 0, 2, 0, 0, 124101, 124101, "ヨリ（クリスマス）", 433, "2024/11/16 15:00:00", 1, 6, 0, 450, 0, "【魔法】中衛で、光を灯し幸せを届ける双子の姉サンタ。\n最も近い１キャラの魔法攻撃力や行動速度アップ、ＴＰの\n回復に加え、全員を支援するスキルで聖夜の勝利を飾る。", 1, 0, 124101, 1.965, 0, "2030/12/31 15:00:00", 124101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("じゅん", 5, 0, 0, 1, 0, 0, 124201, 124201, "ジュン（クリスマス）", 144, "2022/12/23 12:00:00", 3, 5, 0, 450, 0, "【物理】前衛で、味方を庇護し祝福する聖白の騎士団長。\nスキルで後方の味方の攻撃能力を強化、ＴＰを回復させ、\n防御力ダウンと自分のＨＰを回復するＵＢで勝機を掴む。", 0, 0, 124201, 2.07, 0, "2030/12/31 15:00:00", 124201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あん", 0, 1, 181001, 0, 0, 0, 124301, 0, "アン（アン＆グレア）", 577, "2015/04/01 15:00:00", 3, 0, 0, 0, 0, "", 1, 0, 124301, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぐれあ", 0, 1, 181001, 0, 0, 0, 124401, 0, "グレア（アン＆グレア）", 577, "2015/04/01 15:00:00", 3, 0, 0, 0, 0, "", 1, 0, 124401, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ほまれ", 7, 0, 0, 2, 0, 0, 124501, 124501, "ホマレ（ニューイヤー）", 707, "2025/01/15 15:00:00", 3, 21, 0, 450, 0, "【魔法】後衛で、魔力を笑顔に隠す晴れ着姿の龍の首魁。\n自分の攻撃強化とＴＰ回復をし、ＵＢで放つ曙光の落涙は\n敵数で威力と防御力の減少量を上げ、全ての災厄を祓う。", 1, 0, 124501, 2.07, 0, "2025/01/20 11:59:59", 124501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みさと", 7, 0, 0, 2, 0, 0, 124601, 124601, "ミサト（ニューイヤー）", 698, "2025/01/15 15:00:00", 3, 21, 0, 450, 0, "【魔法】後衛で真心重ねて味方をもてなす仲居姿の先生。\n全スキルで味方の物理攻撃力とクリティカル能力を上げ、\n魔防やＴＰ上昇の支援とＨＰ、ＴＰの回復で万福を願う。", 1, 0, 124601, 2.44, 0, "2025/01/20 11:59:59", 124601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みつき", 7, 0, 0, 1, 0, 0, 124701, 124701, "ミツキ（ニューイヤー）", 590, "2024/12/16 15:00:00", 1, 46, 0, 450, 0, "【物理】中衛で、振袖姿で旅館に手を貸す隻眼の闇医者。\n朧ろ状態にした敵への攻撃時、スキルのダメージや防御力\nのダウン値が上昇し、紫煙に捉えた敵を艶然と討ち取る。", 1, 0, 124701, 2.24, 0, "2030/12/31 15:00:00", 124701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("のぞみ", 4, 0, 0, 1, 0, 0, 124801, 124801, "ノゾミ（リベレイター）", 423, "2025/02/20 12:00:00", 3, 0, 0, 450, 0, "【物理】中衛で、未来を信じ希望を灯すトップアイドル。\nバトル開始時に物理キャラのＴＰ特大回復と敵の永続物防\nダウンで加勢し、物理攻撃強化とＴＰ回復で勝利へ導く。", 1, 0, 124801, 2.14, 0, "2025/02/24 11:59:59", 124801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かや", 1, 0, 0, 1, 0, 0, 124901, 124901, "カヤ（リベレイター）", 170, "2025/01/16 15:00:00", 1, 0, 0, 450, 0, "【物理】前衛で先陣を切り未来を掴む喧嘩屋ドラゴン族。\n初弾が大幅強化するスキルで自分の攻撃力とＴＰを大きく\n高め、威力を増したＵＢで先制し群がる敵を薙ぎ払う。", 1, 0, 124901, 1.965, 0, "2030/12/31 15:00:00", 124901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("むいみ", 5, 0, 0, 1, 0, 0, 125001, 125001, "ムイミ（リベレイター）", 221, "2025/02/20 12:00:00", 3, 0, 0, 450, 0, "【物理】前衛で、相棒と共に明日へと進む大悪党の少女。\n自己強化や物防ダウンを駆使するムイミと、ＵＢ後に一定\n時間共闘するオクトーの追撃で、輝く未来を取り戻す。", 1, 0, 125001, 1.965, 0, "2025/02/24 11:59:59", 125001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("たまき", 8, 0, 0, 1, 0, 0, 125101, 125101, "タマキ（カフェ）", 825, "2023/03/03 19:00:00", 3, 47, 0, 450, 0, "【物理】後衛から客を癒しもてなす猫カフェ店員の猫娘。\n物攻の高いキャラの傍で周囲の物攻アップやＨＰとＴＰを\n回復し、周囲の味方数で強化される攻撃で敵を一掃する。", 0, 0, 125101, 2.24, 0, "2030/12/31 15:00:00", 125101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("もにか", 4, 0, 0, 1, 0, 0, 125201, 125201, "モニカ（カフェ）", 463, "2023/03/10 12:00:00", 3, 4, 0, 450, 0, "【物理】中衛で、駄菓子を振舞い福を蒔く猫カフェ店員。\n攻撃を３回受けるまで味方全体の物理攻撃力を極大アップ\nさせ、２種の物防ダウンスキルで序盤を一気に加勢する。", 0, 0, 125201, 1.965, 0, "2030/12/31 15:00:00", 125201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("こっころ", 6, 0, 0, 1, 0, 0, 125301, 125301, "コッコロ（レンジャー）", 752, "2025/04/26 12:00:00", 3, 6, 0, 450, 0, "【物理】後衛で、わんわんと一緒の新緑レンジャー少女。\n自分の攻撃力に応じて強化される物理攻撃支援スキルや\nＨＰ継続回復、バリアで周囲を支え、絆の勝利へと導く。", 1, 0, 125301, 2.07, 0, "2025/04/30 11:59:59", 125301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しおり", 8, 0, 0, 1, 0, 0, 125401, 125401, "シオリ（レンジャー）", 710, "2023/04/10 12:00:00", 3, 8, 0, 450, 0, "【物理】後衛で、相棒と共に山を駆ける新米レンジャー。\nスキルで自分の攻撃力とクリティカル時のダメージを上げ\nＴＰを回復し、ダメージと防御力ダウンで敵を追い込む。", 0, 0, 125401, 2.09, 0, "2030/12/31 15:00:00", 125401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("じーた", 7, 0, 0, 2, 0, 0, 125501, 125501, "ジータ（ウォーロック）", 443, "2025/05/15 15:00:00", 3, 50, 0, 450, 0, "【魔法】中衛で、他の術者と魔力を束ねる究竟の魔導士。\n味方への魔法攻撃支援とＴＰ回復に加え、敵陣の攻防両面\nの弱体化で戦況を整え、自らも強力な攻撃魔法を放つ。", 1, 0, 125501, 1.92, 0, "2025/05/31 11:59:59", 125501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("びから", 51, 0, 0, 1, 0, 0, 125601, 125601, "ビカラ", 267, "2025/05/15 15:00:00", 3, 0, 0, 450, 0, "【物理】前衛で夢と希望とネズ耳を届ける鼠神宮の巫女。\n周囲の味方の物理攻撃支援、ＴＰ上昇アップと回復で援護\nし、自身の無敵化で敵の隙を突き鋭い金牙の一撃を放つ。", 1, 0, 125601, 2.09, 0, "2025/05/31 11:59:59", 125601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かりん", 7, 0, 0, 2, 0, 0, 125701, 125701, "カリン（アルケミスト）", 579, "2025/04/16 15:00:00", 1, 9, 0, 450, 0, "【魔法】中衛で森羅万象を究め味方を支援する錬金術師。\n物理、魔法の属性を問わない敵の弱体化と味方の強化に加\nえ、スキルによる高頻度のＨＰ回復で盤石な戦局を築く。", 1, 0, 125701, 2.24, 0, "2030/12/31 15:00:00", 125701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りり", 3, 0, 0, 1, 0, 0, 125801, 125801, "リリ（フォールン）", 464, "2023/04/17 12:00:00", 3, 0, 0, 450, 0, "【物理】中衛で、黒羽の力を使い空を制する嘆鎌の少女。\nバトル開始時に、敵の範囲攻撃を躱す【飛行】状態となり\n生成したシャドウと共に、眼前の敵を一薙ぎに斬り払う。", 0, 0, 125801, 2.09, 0, "2030/12/31 15:00:00", 125801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かや", 1, 0, 0, 0, 0, 0, 125901, 0, "カヤ（リベレイター）", 0, "2015/04/01 15:00:00", 3, 1, 0, 0, 0, "", 1, 0, 125901, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くりあ", 0, 0, 0, 1, 0, 0, 126001, 126001, "クリア（フォールン）", 406, "2023/10/31 12:00:00", 3, 0, 0, 450, 0, "【物理】中衛から、我が身を盾に味方を守る隠棘の少女。\nバトル開始時【飛行】し、最もＨＰの低い味方をかばい、\n味方のＨＰに応じて強化されるスキルで敵を牽制する。", 0, 0, 126001, 2.09, 0, "2030/12/31 15:00:00", 126001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぷれしあ", 44, 0, 0, 2, 0, 0, 126101, 126101, "プレシア（フォールン）", 480, "2023/11/15 15:00:00", 3, 53, 0, 450, 0, "【魔法】中衛で、マイペースに味方を支える破杖の少女。\n【飛行】し、クリティカルの強化やＨＰ・ＴＰ回復で味方\nを支援し、魔法攻撃力を加えた物理攻撃で敵を平らげる。", 0, 0, 126101, 2.09, 0, "2030/12/31 15:00:00", 126101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いりや", 3, 0, 0, 2, 0, 0, 126201, 126201, "イリヤ（儀装束）", 568, "2025/06/10 12:00:00", 3, 3, 0, 450, 0, "【魔法】中衛で、眷属と永久の血盟を誓う月下の吸血鬼。\nＵＢで眷属を２体喚び、味方への攻撃支援や行動速度上昇\nで強化し、眷属と共に見舞う猛攻で前途を阻む敵を討つ。", 1, 0, 126201, 2.09, 0, "2025/06/20 11:59:59", 126201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆき", 7, 0, 0, 2, 0, 0, 126301, 126301, "ユキ（儀装束）", 456, "2023/06/15 15:00:00", 3, 9, 0, 450, 0, "【魔法】中衛で、闇色の儀装束を纏う「美を統べる者」。\nステータスアップ効果を受け【美貌】を増し、魔法攻撃力\nダウンや味方の強化、ＴＰ回復の効果を高めて解き放つ。", 0, 0, 126301, 2.07, 0, "2030/12/31 15:00:00", 126301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くろーちぇ", 1, 0, 0, 1, 0, 0, 126401, 126401, "クローチェ", 373, "2025/08/31 12:00:00", 3, 1, 0, 450, 0, "【物理】中衛で着脱可能な鉄腕を放つ機械人族のロボ娘。\nＵＢ発動で【フルチャージ】状態になり、【バッテリー】\nが切れるまで強化スキルを連発し、一帯を超速圧砕する。", 1, 0, 126401, 2.09, 0, "2025/09/16 14:59:59", 126401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らいらえる", 7, 0, 0, 2, 0, 0, 126501, 126501, "ライラエル", 740, "2025/08/31 12:00:00", 3, 0, 0, 450, 0, "【魔法】後衛で優美にほほ笑むジオ・テオゴニアの姫君。\n開始時に発動する【界雷】で、敵味方に影響を与えつつ、\n魔法防御ダウンと強力なダメージスキルで裁きを下す。", 1, 0, 126501, 1.965, 0, "2025/09/16 14:59:59", 126501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねねか", 7, 0, 0, 2, 0, 0, 126601, 126601, "ネネカ（サマー）", 650, "2025/08/10 12:00:00", 3, 7, 0, 450, 0, "【魔法】後衛で、涼しげに微笑む夏色姿の『変貌大妃』。\nスキルで味方を大幅に強化し、最も魔法攻撃力が高い味方\nの魔法攻撃力を写し取った攻撃力で、強力なＵＢを放つ。", 1, 0, 126601, 2.04, 0, "2025/08/15 14:59:59", 126601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あきの", 5, 0, 0, 1, 0, 0, 126701, 126701, "アキノ（サマー）", 224, "2025/06/17 15:00:00", 1, 5, 0, 450, 0, "【物理】前衛で、優雅なバカンスを過ごす夕映えの令嬢。\n敵が魔法攻撃をする場合に効果を大幅に上げる２種の範囲\n攻撃と攻防両面の支援スキルで、盛夏の勝鬨を上げる。", 1, 0, 126701, 1.965, 0, "2030/12/31 15:00:00", 126701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆかり", 5, 0, 0, 1, 0, 0, 126801, 126801, "ユカリ（サマー）", 159, "2023/07/15 15:00:00", 3, 5, 0, 450, 0, "【物理】前衛で、夏の麦しゅわを嗜むビーチの元聖騎士。\n敵単体にダメージを与えながら、周囲の味方への魔法無効\nバリア付与と魔防アップで守りを固めて勝利の波に乗る。", 0, 0, 126801, 1.97, 0, "2030/12/31 15:00:00", 126801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らんふぁ", 7, 0, 0, 2, 0, 0, 126901, 126901, "ランファ（サマー）", 682, "2025/08/22 12:00:00", 3, 21, 0, 450, 0, "【魔法】後衛で、密やかな潮騒に耳を傾ける晩陽の歌姫。\n魔法クリティカルの極大アップを筆頭に攻防両面で周囲の\n味方を強化し、さらに自身もＵＢで数多の敵を退かせる。", 1, 0, 126901, 1.965, 0, "2025/08/31 11:59:59", 126901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くうか", 2, 0, 0, 1, 0, 0, 127001, 127001, "クウカ（サマー）", 133, "2025/07/16 15:00:00", 1, 52, 0, 450, 0, "【物理】前衛で新たな刺激を追い求める水着姿のドＭ娘。\n自分のＨＰが下がるほど効果量が上昇するスキルの物理攻\n撃力アップとＵＢのダメージで、勝利の大海へ飛び込む。", 1, 0, 127001, 1.97, 0, "2030/12/31 15:00:00", 127001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しのぶ", 5, 0, 0, 1, 0, 0, 127101, 127101, "シノブ（サマー）", 255, "2025/08/22 12:00:00", 3, 46, 0, 450, 0, "【物理】前衛で、穏やかな水面に揺蕩う夜光の霊能少女。\n召喚した親父に敵の攻撃を引き付けさせつつ、シノブ自身\nの攻撃性能強化と防御ダウンを扱い、敵を冥海へと誘う。", 1, 0, 127101, 2.09, 0, "2025/08/31 11:59:59", 127101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("きゃる", 7, 0, 0, 2, 0, 0, 127201, 127201, "キャル（編入生）", 804, "2025/09/16 15:00:00", 3, 7, 0, 450, 0, "【魔法】後衛で、制服姿に胸を高鳴らせるアオハル猫娘。\n攻防両面のサポートに加え行動速度アップとＴＰ回復で味\n方を支援し、最も遠くの敵を狙うＵＢで輝く勝利を得る。", 1, 0, 127201, 2.09, 0, "2025/09/30 11:59:59", 127201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("すずな", 8, 0, 0, 1, 0, 0, 127301, 127301, "スズナ（編入生）", 750, "2023/09/15 15:00:00", 3, 8, 0, 450, 0, "【物理】後衛でもにカワ制服を着こなすカリスマモデル。\nクリティカル時に味方を強化するスキルや、追加ダメージ\nが発生するＵＢによって青春の一ページを切り取る。", 0, 0, 127301, 2.09, 0, "2030/12/31 15:00:00", 127301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("びから", 1, 0, 0, 0, 0, 0, 127401, 0, "ビカラ（コラボ）", 0, "2015/04/01 15:00:00", 3, 1, 0, 0, 0, "", 1, 0, 127401, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("されん", 4, 0, 0, 1, 0, 0, 127501, 127501, "サレン（サラサリア）", 304, "2024/11/11 12:00:00", 3, 4, 0, 450, 0, "【物理】中衛で、優艶に炎と踊り舞う情熱のサレンママ。\n物理攻撃から味方を守り、【炎舞の刻印】の数に応じて効\n果の上がる物攻アップとＴＰ回復で皆を奮い立たせる。", 1, 0, 127501, 2.09, 0, "2024/11/18 11:59:59", 127501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("るか", 4, 0, 0, 1, 0, 0, 127601, 127601, "ルカ（サラサリア）", 157, "2023/10/15 15:00:00", 3, 4, 0, 450, 0, "【物理】前衛で、空飛ぶ絨毯で巡り回るオアシスの姉御。\n自分の物防を大幅に高めて敵を挑発するスキルと敵のＴＰ\nとＴＰ上昇をダウンさせるＵＢで、爽やかに勝利を掴む。", 0, 0, 127601, 1.965, 0, "2030/12/31 15:00:00", 127601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りんど", 6, 0, 0, 2, 0, 0, 127701, 127701, "リンド", 693, "2024/10/10 12:00:00", 3, 48, 0, 450, 0, "【魔法】後衛で、メイド業に奔走する双子ドラゴンの姉。\nＵＢのフィールド展開中は攻撃、防御、ＴＰ回復と多彩な\n支援スキルの効果が再発動し味方を手厚くサポートする。", 0, 0, 127701, 1.965, 0, "2030/12/31 15:00:00", 127701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("うるむ", 7, 0, 0, 2, 0, 0, 127801, 127801, "ヴルム", 706, "2024/10/18 12:00:00", 3, 47, 0, 450, 0, "【魔法】後衛で、文句を言いつつ働く双子ドラゴンの妹。\nダメージと魔法防御力ダウンを両立するスキルを持つが、\n目を離すと【サボりの誘惑】に負け、手を抜いてしまう。", 0, 0, 127801, 1.965, 0, "2030/12/31 15:00:00", 127801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぺこりーぬ", 5, 0, 0, 2, 0, 0, 127901, 127901, "ペコリーヌ（クリスマス）", 372, "2024/12/09 12:00:00", 3, 5, 0, 450, 0, "【魔法】中衛でみんなに笑顔を届ける腹ペコサンタ王女。\n前線で敵の攻撃を耐えながら範囲内の味方の防御サポート\nと敵の防御ダウンまでこなし、聖夜に勝利の輝きを灯す。", 1, 0, 127901, 1.965, 0, "2024/12/15 14:59:59", 127901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くれじった", 35, 0, 0, 1, 0, 0, 128001, 128001, "クレジッタ（クリスマス）", 723, "2023/12/15 15:00:00", 3, 35, 0, 450, 0, "【物理】後衛で、甘美なひと時を堪能する聖夜の女商人。\n最も遠い味方へのＴＰ回復や、初弾に追加効果のある攻撃\nで敵の弱体化と味方の強化を行い、勝利の舞台を整える。", 0, 0, 128001, 2.09, 0, "2030/12/31 15:00:00", 128001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しずる", 0, 1, 181101, 0, 0, 0, 128101, 0, "シズル（シズル&リノ）", 580, "2015/04/01 15:00:00", 3, 0, 0, 0, 0, "", 1, 0, 128101, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りの", 0, 1, 181101, 0, 0, 0, 128201, 0, "リノ（シズル&リノ）", 580, "2015/04/01 15:00:00", 3, 0, 0, 0, 0, "", 1, 0, 128201, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いのり", 3, 1, 0, 1, 0, 0, 128301, 128301, "イノリ（ニューイヤー）", 191, "2023/12/31 12:00:00", 1, 38, 0, 450, 0, "【物理】前衛で相手をからかうお調子者の年神ドラゴン。\n敵全体を挑発し、敵の妨害スキルにカウンターして前方の\n敵すべてをスタンさせるスキルで戦局を引っ掻き回す。", 1, 0, 128301, 2.09, 0, "2030/12/31 15:00:00", 128301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("はつね", 7, 0, 0, 2, 0, 0, 128401, 128401, "ハツネ（ニューイヤー）", 801, "2025/01/09 12:00:00", 3, 21, 0, 450, 0, "【魔法】後衛で特別な景色を共にする初夢超能力ガール。\n敵が物理攻撃を行う場合、攻撃性能の強化に加えて複数の\n弱体効果が追加され、攻守ともに味方を支援し敵を掃う。", 1, 0, 128401, 2.09, 0, "2025/01/15 14:59:59", 128401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かすみ", 7, 0, 0, 2, 0, 0, 128501, 128501, "カスミ（ニューイヤー）", 739, "2025/01/09 12:00:00", 3, 21, 0, 450, 0, "【魔法】後衛で、絵馬に秘めた願いを祷る新年の名探偵。\n敵と味方の数で効果量が上昇するダメージと攻撃力支援に\n加え、２種類の回復スキルを使いこなして勝利を願う。", 1, 0, 128501, 2.09, 0, "2025/01/15 14:59:59", 128501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りり", 1, 0, 0, 0, 0, 0, 128601, 0, "リリ（フォールン）", 0, "2015/04/01 15:00:00", 3, 1, 0, 0, 0, "", 1, 0, 128601, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ひより", 1, 0, 0, 1, 0, 0, 128701, 128701, "ヒヨリ（アストラル）", 226, "2025/02/10 12:00:00", 3, 0, 0, 450, 0, "【物理】前衛で、煌炎宿し希望を振りまく覚醒の元気娘。\n放つ炎は敵を攻守ともに弱化させて同時に味方を鼓舞し、\n２種のＴＰ回復効果で攻勢を絶やさず勝利を呼び込む。", 1, 0, 128701, 2.09, 0, "2025/02/15 14:59:59", 128701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("れい", 4, 0, 0, 1, 0, 0, 128801, 128801, "レイ（アストラル）", 194, "2025/08/16 15:00:00", 1, 0, 0, 450, 0, "【物理】前衛で、旋風を纏い未来へ駆ける覚醒の剣士。\n目にも止まらぬ速さの剣技で敵を吹き飛ばしスタンさせ、\n仲間の守りを固めるスキルを駆使し勝利の道を切り開く。", 1, 0, 128801, 1.965, 0, "2030/12/31 15:00:00", 128801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆい", 7, 0, 0, 2, 0, 0, 128901, 128901, "ユイ（アストラル）", 772, "2025/02/10 12:00:00", 3, 0, 0, 450, 0, "【魔法】後衛で、願いを力に極光を放つ覚醒の魔法士。\n自分を強化しながら高火力魔法を絶えず撃ち込み、バリア\nを起点とした味方への攻撃支援スキルで勝利を手にする。", 1, 0, 128901, 2.09, 0, "2025/02/15 14:59:59", 128901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("えりす", 7, 0, 0, 2, 0, 0, 129001, 129001, "エリス", 800, "2025/08/31 12:00:00", 3, 0, 0, 450, 0, "【魔法】後衛で、眠りから目覚め美しく咲き誇る黒薔薇。\n終焉を超えし【回帰の薔薇】と、行動速度アップを始めと\nした多種の攻防支援で味方を強化し、新たな未来を掴む。", 1, 0, 129001, 2.09, 0, "2025/09/16 14:59:59", 129001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆに", 7, 0, 0, 1, 0, 0, 129301, 129301, "ユニ（ウィンター）", 708, "2025/03/10 12:00:00", 3, 7, 0, 450, 0, "【物理】後衛で、退廃的な冬の学びに溺れる水際の才媛。\n物理攻撃の強化、回復、行動速度アップで味方を支援し、\nＵＢで得た【水際の安寧】を死守するため膂力を振るう。", 1, 0, 129301, 2.09, 0, "2025/03/15 14:59:59", 129301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くろえ", 2, 0, 0, 1, 0, 0, 129401, 129401, "クロエ（ウィンター）", 188, "2024/03/18 12:00:00", 3, 2, 0, 450, 0, "【物理】前衛で、水面に映る神速のダウナー系水着女子。\n攻撃を当てる度に敵に付与する【水月】の数に応じて物防\nダウンやダメージの効果が上昇し、必勝の抜き手を切る。", 0, 0, 129401, 2.09, 0, "2030/12/31 15:00:00", 129401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ちえる", 1, 0, 0, 1, 0, 0, 129501, 129501, "チエル（ウィンター）", 247, "2025/06/20 12:00:00", 3, 1, 0, 450, 0, "【物理】前衛で、ちぇるっとちぇるるな水着のちえるん。\nステータスアップで溜まる【ちぇる】を、自身の火力や\n支援能力に還元して、真冬の真夏をちぇらるれれぽぱぴ？", 1, 0, 129501, 2.09, 0, "2025/06/27 11:59:59", 129501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あねもね", 0, 0, 0, 1, 0, 0, 129601, 129601, "アネモネ", 550, "2025/08/31 12:00:00", 3, 0, 0, 450, 0, "【物理】中衛で怜悧麗花の陣を張るアルラウネの妖魔人。\n敵の攻撃力、防御力、与ダメージを下げ、ＴＰを吸収し、\nＵＢの継続ダメージで領域を侵す敵を絶えず拒み退ける。", 1, 0, 129601, 2.09, 0, "2025/09/16 14:59:59", 129601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねふぃーねら", 0, 0, 0, 1, 0, 0, 129701, 129701, "ネフィ＝ネラ", 540, "2025/08/31 12:00:00", 3, 0, 0, 450, 0, "【物理】中衛で万魔の頂点に君臨するジオ・ゲヘナの媛。\n環境効果【妨魔塵】で魔法攻撃を阻害し、行動速度アップ\n等の支援や苛烈な攻撃で無謀な不届き者を平伏させる。", 1, 0, 129701, 2.09, 0, "2025/09/16 14:59:59", 129701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("まこと", 5, 0, 0, 1, 0, 0, 129801, 129801, "マコト（コマンダー）", 269, "2025/04/26 12:00:00", 3, 5, 0, 450, 0, "【物理】前衛で、情と熱意で仲間を束ねる指揮官の狼娘。\n敵の攻守を削りつつ、自分のＴＰ回復や対象が物防ダウン\n状態の時に発生する追撃で猛攻を仕掛け前線を突破する。", 1, 0, 129801, 2.09, 0, "2025/04/30 11:59:59", 129801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("えりこ", 6, 0, 0, 1, 0, 0, 129901, 129901, "エリコ（コマンダー）", 294, "2024/04/15 15:00:00", 3, 48, 0, 450, 0, "【物理】前衛で、苛烈な教えで味方を率いる狂恋の教官。\nＴＰ回復や防御支援に加え味方の人数で効果アップする攻\n撃支援と大ダメージで、味方全体を奮い立たせ敵を破る。", 0, 0, 129901, 1.84, 0, "2030/12/31 15:00:00", 129901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("やまと", 4, 0, 0, 1, 0, 0, 130001, 130001, "ヤマト", 150, "2025/05/03 19:00:00", 3, 0, 0, 450, 0, "【物理】前衛で、豪胆にスリルを嗜む盗賊ギルドの長女。\n最前線で命を張りながら、獲得した【バンディダイス】の\n消費によって自らを大幅強化し、有象無象を地に伏せる。", 1, 0, 130001, 2.09, 0, "2025/05/15 14:59:59", 130001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("わかな", 7, 0, 0, 1, 0, 0, 130101, 130101, "ワカナ", 535, "2025/05/03 19:00:00", 3, 9, 0, 450, 0, "【物理】中衛の、貧乏クジを引きがちな盗賊ギルド次女。\n召喚したスキッドがワカナをかばって前線に立ち、自身は\n攻撃支援にＨＰとＴＰ回復まで、献身的に味方を支える。", 1, 0, 130101, 2.09, 0, "2025/05/15 14:59:59", 130101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ふぶき", 5, 0, 0, 1, 0, 0, 130201, 130201, "フブキ", 371, "2025/05/03 19:00:00", 3, 0, 0, 450, 0, "【物理】中衛の、ナマイキで超天才な盗賊ギルドの三女。\n【味方バリアー♡】で自分へのダメージを味方に押し付け\nＨＰ最大でダメージアップする範囲攻撃で敵を蹂躙する。", 1, 0, 130201, 1.84, 0, "2025/05/15 14:59:59", 130201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("れい", 4, 0, 0, 0, 0, 0, 130601, 0, "レイ（アストラル）", 0, "2015/04/01 15:00:00", 3, 1, 0, 0, 0, "", 1, 0, 130601, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("きょうか", 7, 0, 0, 2, 0, 0, 130701, 130701, "キョウカ（スプリング）", 563, "2025/05/03 19:00:00", 3, 7, 0, 450, 0, "【魔法】中衛で、お花畑に春を届ける花衣装の優等生。\nスキル発動回数に応じた効率的な自己強化やクリティカル\n時の追加効果を持つスキルとＵＢで勝利の風を吹かせる。", 1, 0, 130701, 1.92, 0, "2025/05/15 14:59:59", 130701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("すずめ", 7, 0, 0, 2, 0, 0, 130801, 130801, "スズメ（スプリング）", 558, "2024/05/15 15:00:00", 3, 7, 0, 450, 0, "【魔法】中衛で、春に彩られた花衣装のドジっ娘メイド。\n範囲内の敵にダメージを与えながら、多数の弱体化効果を\n持つスキルやＵＢを駆使して、穏やかに吹く勝利を掴む。", 0, 0, 130801, 1.84, 0, "2030/12/31 15:00:00", 130801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くるる", 7, 0, 0, 2, 0, 0, 130901, 130901, "クルル", 440, "2024/06/15 15:00:00", 3, 7, 0, 450, 0, "【魔法】中衛で、皆を夢の世界に誘う宝石兎族の支配人。\nステータスアップ効果を受けるたびに【かばばん君】を増\nやし、反射的に味方へ攻撃支援の恩返しをしてしまう。", 0, 0, 130901, 2.09, 0, "2030/12/31 15:00:00", 130901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("まほ", 7, 0, 0, 2, 0, 0, 131001, 131001, "マホ（ドリームパーク）", 702, "2025/06/10 12:00:00", 3, 7, 0, 450, 0, "【魔法】後衛で、サーカスの舞台に輝くメルヘン少女。\n味方の攻防支援や敵の攻防弱体化の他【カーテンコール】\n付与時の追加ダメージスキルで、勝利のライトを照らす。", 1, 0, 131001, 1.84, 0, "2025/06/20 11:59:59", 131001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねあ", 2, 0, 0, 1, 0, 0, 131101, 131101, "ネア（サマー）", 165, "2024/06/30 12:00:00", 3, 52, 0, 450, 0, "【物理】前衛でハグの機会を窺う水着のスライムギャル。\n攻撃してきた敵に【ネバネバ】を自動で付着させ、攻撃力\nダウンやダメージ、束縛など複数の効果を引き起こす。", 0, 0, 131101, 2.09, 0, "2030/12/31 15:00:00", 131101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("みそら", 54, 0, 0, 2, 0, 0, 131201, 131201, "ミソラ（サマー）", 753, "2025/07/10 12:00:00", 3, 54, 0, 450, 0, "【魔法】後衛で夏の盛りにイイコトをする溌溂水着少女★\n【PSI★ストーム】をチャージし、連続攻撃で敵を殲滅し\nて、継続ＴＰ回復やバリアで抜け目なく味方を支援する。", 1, 0, 131201, 2.09, 0, "2025/07/23 11:59:59", 131201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りり", 1, 1, 0, 0, 0, 0, 131301, 0, "リリ", 0, "2015/04/01 15:00:00", 3, 1, 0, 0, 0, "", 1, 0, 131301, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くりあ", 1, 1, 0, 0, 0, 0, 131401, 0, "クリア", 0, "2015/04/01 15:00:00", 3, 1, 0, 0, 0, "", 1, 0, 131401, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぷれしあ", 1, 1, 0, 0, 0, 0, 131501, 0, "プレシア", 0, "2015/04/01 15:00:00", 3, 1, 0, 0, 0, "", 1, 0, 131501, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("りり", 4, 0, 0, 1, 0, 0, 131601, 131601, "リリ（サマー）", 399, "2025/07/10 12:00:00", 3, 4, 0, 450, 0, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 1, 0, 131601, 1.92, 0, "2025/07/23 11:59:59", 131601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あめす", 44, 0, 0, 2, 0, 0, 131701, 131701, "アメス（サマー）", 743, "2025/08/10 12:00:00", 3, 53, 0, 450, 0, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 1, 0, 131701, 1.92, 0, "2025/08/15 14:59:59", 131701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ほまれ", 7, 0, 0, 2, 0, 0, 131801, 131801, "ホマレ（サマー）", 709, "2024/08/15 15:00:00", 3, 21, 0, 450, 0, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 0, 0, 131801, 2.09, 0, "2030/12/31 15:00:00", 131801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("えみりあ", 7, 1, 0, 2, 1, 0, 131901, 131901, "エミリア（サマー）", 725, "2024/08/31 12:00:00", 1, 23, 0, 450, 0, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 1, 0, 131901, 2.09, 0, "2030/12/31 15:00:00", 131901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("えきどな", 7, 0, 0, 2, 1, 0, 132001, 132001, "エキドナ（サマー）", 775, "2025/10/10 12:00:00", 3, 21, 0, 450, 0, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 1, 0, 132001, 2.09, 0, "2025/10/24 11:59:59", 132001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("れむ", 13, 0, 0, 1, 1, 0, 132101, 132101, "レム（サマー）", 146, "2025/10/10 12:00:00", 3, 24, 0, 450, 0, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 1, 0, 132101, 2.09, 0, "2025/10/24 11:59:59", 132101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("のぞみ", 7, 0, 0, 2, 0, 0, 132201, 132201, "ノゾミ（アルケミスト）", 721, "2025/05/03 19:00:00", 3, 7, 0, 450, 0, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 1, 0, 132201, 1.84, 0, "2025/05/15 14:59:59", 132201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("るいずまりー", 7, 0, 0, 2, 0, 0, 132301, 132301, "ルイズマリー", 754, "2025/05/03 19:00:00", 3, 7, 0, 450, 0, "【魔法】後衛で、底知れぬ叡智を秘めた天才錬金術師。\n高い方の防御力でダメージを受ける調和状態を付与し、\n２回まで性能が上昇していくＵＢで、妄想を爆発させる。", 1, 0, 132301, 2.09, 0, "2025/05/15 14:59:59", 132301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いろは", 5, 0, 0, 1, 0, 0, 132401, 132401, "イロハ", 501, "2025/06/20 12:00:00", 3, 0, 0, 450, 0, "【物理】中衛で、大きな体で無邪気に遊び回る天才剣士。\n戦いの中で【剣圧】を溜め、その後のスキルやＵＢで物防\n一定無視のダメージを連発し、才気煥発の活躍を見せる。", 0, 0, 132401, 2.09, 0, "2030/12/31 15:00:00", 132401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("その", 7, 0, 0, 2, 0, 0, 132501, 132501, "ソノ", 636, "2025/05/15 15:00:00", 3, 23, 0, 450, 0, "【魔法】後衛で、小柄で大人対応な錬金堂の省エネ店主。\n強力な弱体効果を与えながら、デバフ付与のたび増加する\n【虚脱】が80溜まると本気を出し定時厳守で戦い抜く。", 0, 0, 132501, 2.09, 0, "2030/12/31 15:00:00", 132501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らいらえる", 7, 0, 0, 2, 0, 0, 132801, 132801, "ライラエル（クリスマス）", 750, "2025/06/10 12:00:00", 3, 0, 0, 450, 0, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 1, 0, 132801, 2.09, 0, "2025/06/20 11:59:59", 132801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("いお", 5, 0, 0, 2, 0, 0, 132901, 132901, "イオ（クリスマス）", 748, "2024/12/09 12:00:00", 3, 46, 0, 450, 0, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 0, 0, 132901, 2.09, 0, "2030/12/31 15:00:00", 132901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぐれいす", 0, 0, 0, 1, 0, 0, 133001, 133001, "グレイス", 234, "2025/08/31 12:00:00", 3, 0, 0, 450, 0, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 1, 0, 133001, 2.09, 0, "2025/09/16 14:59:59", 133001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("うぁいおれっと", 0, 0, 0, 1, 0, 0, 133101, 133101, "ヴァイオレット", 154, "2025/08/31 12:00:00", 3, 0, 0, 450, 0, "【物理】前衛で、儚くも凛と咲くジオ・ニヴルヘルの姫。\n継続ダメージ効果を鈍化させる環境効果【忌火】で盾に、\n絶怠霊度の継続割合攻撃で矛となり、静寂の冥府を護る。", 1, 0, 133101, 1.75, 0, "2025/09/16 14:59:59", 133101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("もにか", 4, 1, 0, 1, 0, 0, 133201, 133201, "モニカ（ニューイヤー）", 296, "2024/12/31 12:00:00", 1, 22, 0, 450, 0, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 1, 0, 133201, 2.09, 0, "2030/12/31 15:00:00", 133201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("されん", 4, 0, 0, 2, 0, 0, 133501, 133501, "サレン（ニューイヤー）", 718, "2025/07/10 12:00:00", 3, 22, 0, 450, 0, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 1, 0, 133501, 2.09, 0, "2025/07/23 11:59:59", 133501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("めどぅーさ", 0, 0, 0, 1, 0, 0, 133601, 133601, "メドゥーサ", 445, "2025/07/23 12:00:00", 3, 0, 0, 450, 0, "【物理】中衛で眷属と力を合わせて戦う誇り高き蛇乙女。\n【魔眼】の数に応じて効果量が上がるスキルのダメージと\n弱体化で範囲内の敵を追い詰め、鋭い瞳で石へと変える。", 1, 0, 133601, 2.09, 0, "2025/07/31 11:59:59", 133601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らびりすた", 8, 0, 0, 2, 0, 0, 133701, 133701, "ラビリスタ（アルファ）", 717, "2025/08/15 15:00:00", 3, 0, 0, 450, 0, "【魔法】後衛で、始原の冠装を使いこなす『迷宮女王』。\n水属性の味方のＴＰ上昇を増加する領域を作り、連射攻撃\nで敵の防御を撃ち抜くことで七冠の力を敵に知らしめる。", 1, 0, 133701, 2.09, 0, "2025/08/22 11:59:59", 133701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ねねか", 7, 0, 0, 2, 0, 0, 133801, 133801, "ネネカ（アルファ）", 759, "2025/08/15 15:00:00", 3, 0, 0, 450, 0, "【魔法】後衛から、始原の姿で戦況を操る『変貌大妃』。\n召喚したグレゴールから攻撃支援とＴＰ回復を受け、互い\nの魔力を合わせた連携攻撃で、幽玄なる玉座に君臨する。", 1, 0, 133801, 2.09, 0, "2025/08/22 11:59:59", 133801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くりすてぃーな", 6, 0, 0, 1, 0, 0, 133901, 133901, "クリスティーナ（アルファ）", 228, "2025/08/15 15:00:00", 3, 0, 0, 450, 0, "【物理】前衛で、始原の冠装の力を振るう『誓約女君』。\n10行動目に攻撃力を大幅アップし、スキルに追撃を発生\nさせる【虚数】を得て隔絶した力で楯突く敵を抹消する。", 1, 0, 133901, 2.09, 0, "2025/08/22 11:59:59", 133901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ふぃお", 0, 0, 0, 2, 0, 0, 134001, 134001, "フィオ", 746, "2025/08/31 12:00:00", 3, 0, 0, 450, 0, "【魔法】後衛で、アストルムの冒険へと導くガイド妖精。\nバフとバリアで味方を護りバリアを起点とする攻撃支援、\n風属性の味方への行動速度とＴＰの支援で仲間を支える。", 1, 0, 134001, 2.09, 0, "2025/09/16 14:59:59", 134001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ふぶき", 5, 0, 0, 0, 0, 0, 134101, 0, "フブキ", 0, "2015/04/01 15:00:00", 3, 1, 0, 0, 0, "", 1, 0, 134101, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らいらえる", 7, 0, 0, 0, 0, 0, 134201, 0, "ライラエル（クリスマス）", 0, "2015/04/01 15:00:00", 3, 1, 0, 0, 0, "", 1, 0, 134201, 0.0, 0, "2030/12/31 15:00:00", 0);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("らんふぁ", 7, 0, 0, 2, 0, 0, 134301, 134301, "ランファ（儀装束）", 778, "2025/09/16 15:00:00", 3, 0, 0, 450, 0, "【魔法】後衛で儀装束を纏い精霊と心を通わせる唱喚士。\n敵の数に応じてダメージ量が変化する範囲攻撃や、魔法\n無効バリアなどの支援スキルで想いを詩に乗せ響かせる。", 1, 0, 134301, 2.09, 0, "2025/09/30 11:59:59", 134301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ちか", 7, 0, 0, 2, 0, 0, 134401, 134401, "チカ（儀装束）", 773, "2025/03/15 15:00:00", 3, 21, 0, 450, 0, "【魔法】後衛で儀装束を纏い歌を紡ぎ伝えていく唱喚士。\n自分と最も近くの味方へ強力なバフとＴＰ回復を行うこと\nで攻撃を支援し、共に心を通わせ美しき旋律を奏でる。", 0, 0, 134401, 2.09, 0, "2030/12/31 15:00:00", 134401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くろーちぇ", 0, 0, 0, 2, 0, 0, 134501, 134501, "クローチェ（エアリアル）", 719, "2025/04/08 12:00:00", 3, 0, 0, 450, 0, "【魔法】後衛で超速飛行からの大火力を叩き込むロボ娘。\n上空から速度バフで味方全体を支援しつつ、自分のバリア\nを解除して力へと変え、世界の命運を背負い飛翔する！", 1, 0, 134501, 2.09, 0, "2025/04/15 14:59:59", 134501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あおい", 35, 0, 0, 1, 0, 0, 134601, 134601, "アオイ（パイロット）", 526, "2025/03/31 12:00:00", 3, 35, 0, 450, 0, "【物理】中衛で巨大ロボを駆り戦うぼっちのパイロット。\n敵の弱体化や、味方へバリアを展開するスキルを持ち、\n鋼鉄の乙女から放つ光線はいかに堅固な守りも打ち破る。", 1, 0, 134601, 2.09, 0, "2025/04/08 11:59:59", 134601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ほうおう", 7, 0, 0, 1, 0, 0, 134701, 134701, "ホウオウ", 490, "2025/04/15 15:00:00", 3, 7, 0, 450, 0, "【物理】中衛で、華麗に舞い踊る五色絢爛な煉華の鳳凰。\n攻撃力バフやバリア展開などの攻防支援と、多彩で豊富な\nＨＰ・ＴＰ供給を両立し、浄化の力で皆に安寧を授ける。", 1, 0, 134701, 2.09, 0, "2025/04/26 11:59:59", 134701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("つむぎ", 1, 0, 0, 1, 0, 0, 134801, 134801, "ツムギ（ジオ・ゲヘナ）", 485, "2025/05/31 12:00:00", 3, 1, 0, 450, 0, "【物理】中衛から、新たな素材で紡ぐワイルドテーラー。\n最も物攻が高い他の味方へ重複速度アップやＴＰ・攻撃支\n援を仕立て、全体へのＨＰ回復と併せ攻守を両立させる。", 1, 0, 134801, 1.84, 0, "2025/06/10 11:59:59", 134801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("かのん", 2, 0, 0, 1, 0, 0, 134901, 134901, "カノン", 196, "2025/06/10 12:00:00", 3, 0, 0, 450, 0, "【物理】前衛で、おエレガントな高笑いを轟かすド令嬢。\nＵＢや敵からの攻撃で【お堪忍袋】が尽きると逆上し、強\n化されたスキルと行動パターンで華麗におリベンジする。", 1, 0, 134901, 2.09, 0, "2025/06/20 11:59:59", 134901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("えりす", 7, 0, 0, 2, 0, 0, 135001, 135001, "エリス（サマー）", 785, "2025/06/30 12:00:00", 3, 21, 0, 450, 0, "【魔法】後衛で、永く夢見た本物の夏に咲き綻ぶ黒薔薇。\n【いばらの冠】の呪縛は再臨により解き放たれ、調和状態\nや攻防支援、回復効果を施し、月下の浜辺に静かに佇む。", 1, 0, 135001, 2.09, 0, "2025/07/10 11:59:59", 135001);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しぇふぃ", 4, 0, 0, 1, 0, 0, 135101, 135101, "シェフィ（サマー）", 143, "2025/07/10 12:00:00", 3, 4, 0, 450, 0, "【物理】前衛で盛夏の白波を華麗に乗りこなす氷竜少女。\n敵全体を挑発し、被弾で溜まる【ぐずぐず】をＵＢで発散\nすることで周囲に攻撃支援と天真爛漫な笑顔を振りまく。", 1, 0, 135101, 2.09, 0, "2025/07/23 11:59:59", 135101);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ぷれしあ", 7, 0, 0, 2, 0, 0, 135201, 135201, "プレシア（サマー）", 548, "2025/07/23 12:00:00", 3, 7, 0, 450, 0, "【魔法】中衛で夏の食を満喫し、ぷかぷか漂う天然少女。\nＴＰ・攻撃支援やバリアは味方の数で効果量が変化し、物\n理と魔法攻撃力合算のダメージで夏の思い出を心に刻む。", 1, 0, 135201, 2.09, 0, "2025/07/31 11:59:59", 135201);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("くりあ", 54, 0, 0, 1, 0, 0, 135301, 135301, "クリア（サマー）", 413, "2025/07/31 12:00:00", 3, 54, 0, 450, 0, "【物理】中衛で友情の芽を育む、真夏の『普通』の少女。\n【プルメリアのお守り】で強力な一撃から先頭を守り、味\n方の数で効果量が変化するスキルを鮮やかに命中させる。", 1, 0, 135301, 2.09, 0, "2025/08/10 11:59:59", 135301);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あねもね", 2, 0, 0, 2, 0, 0, 135401, 135401, "アネモネ（サマー）", 553, "2025/08/10 12:00:00", 3, 52, 0, 450, 0, "【魔法】中衛で砂浜の木陰に微睡むアルラウネの妖魔人。\n行動速度アップや初回使用時に回復量が増加するＴＰ回復\nを起点に支援し、穏やかな木漏れ日と共にゆらゆら憩う。", 1, 0, 135401, 2.09, 0, "2025/08/15 14:59:59", 135401);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("あいら", 1, 0, 0, 1, 0, 0, 135501, 135501, "アイラ", 213, "2025/08/31 12:00:00", 3, 0, 0, 450, 0, "【物理】前衛で、世界を守り笑顔を咲かせる情熱の豪炎。\n前方の敵全てを対象とする連撃の強化通常攻撃や、天楼覇\n断剣から放たれる極大ダメージの一閃で未来を切り拓く。", 1, 0, 135501, 2.09, 0, "2025/09/08 11:59:59", 135501);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("しなつ", 4, 0, 0, 1, 0, 0, 135601, 135601, "シナツ", 198, "2025/09/08 12:00:00", 3, 0, 0, 450, 0, "【物理】前衛から、風裂く刃で世界を護る孤高の剣豪。\n卓越した剣技で敵の攻撃を捌いて反撃し、初回ＵＢで生成\nする分身と共に疾風迅雷の攻めで、未来へと駆け抜ける。", 1, 0, 135601, 0.4, 0, "2025/09/16 14:59:59", 135601);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ひより", 1, 0, 0, 1, 0, 0, 135701, 135701, "ヒヨリ（サラサリア）", 291, "2025/09/16 15:00:00", 3, 0, 0, 450, 0, "【物理】前衛で、二人きりの月下の空旅にときめく黒猫。\n物防弱体の他、ダメージ100ヒット後には華麗なステップ\nの追撃とＴＰ回復量増加で、砂漠の夜空に花を咲かせる。", 0, 0, 135701, 1.84, 0, "2030/12/31 15:00:00", 135701);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("ゆきの", 7, 0, 0, 2, 0, 0, 135801, 135801, "ユキノ", 830, "2025/09/30 12:00:00", 3, 0, 0, 450, 0, "【魔法】後衛から、雪魄氷姿の三味を弾じる初心な雪女。\n多様なデバフ効果で敵を弱体化させ、最も魔防の低い敵の\n状態に応じて発生する追加効果で、冥府を真白に染める。", 1, 0, 135801, 2.09, 0, "2025/10/10 11:59:59", 135801);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("さつき", 3, 0, 0, 1, 0, 0, 135901, 135901, "サツキ", 219, "2025/10/10 12:00:00", 3, 0, 0, 450, 0, "【物理】前衛で、華奢な体躯に厚い仁義を宿す鬼のお嬢。\n攻防自己強化や行動不能無効化で豪胆に立ち続け、自分が\n呪詛状態の時に振るう追加攻撃で、怪力無双の力を示す。", 1, 0, 135901, 1.84, 0, "2025/10/24 11:59:59", 135901);
INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("なーな", 0, 0, 0, 1, 0, 0, 136201, 0, "ナーナ", 0, "2015/04/01 15:00:00", 1, 1, 0, 0, 0, "", 0, 0, 136201, 0.0, 0, "2030/12/31 15:00:00", 0);
