INSERT INTO `v1_d87ac5d8ae2538a8b04e8b595a40a6a17629696d336b3d7041d2c37226103cdc` VALUES ("にのん", 8, 0, 0, 2, 0, 0, 137101, 137101, "ニノン（サマー）", 566, "2025/08/15 15:00:00", 3, 47, 0, 450, 0, "【魔法】中衛で陽光の下、煌く水面を共に駆けるシノビ。\n【水遁の印】を自らの攻撃力へと変え、束縛フィールドと\n水遁の術で最も遠い敵とその周囲に速やかな天誅を下す。", 0, 0, 137101, 2.09, 0, "2030/12/31 15:00:00", 137101);
